    <h2>TENEMOS UNA VISIÓN HOLÍSTICA DE LA <span>ECONOMÍA HALAL</span></h2>
    <p>
    Nuestra misión es consolidar el respeto y cumplimiento de los requisitos, normas y estándares de la cultura y la ECONOMÍA HALAL, como un aporte transversal al desarrollo sostenible, a la globalización de la economía y al comercio mundial.
